webpackJsonp([0xbe1ab1fe2fc],{1171:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/getting-your-source-code-hosted-on-google-code/index.md absPath of file >>> MarkdownRemark",html:'<p>Well, I\'ve finally gone and done it - I\'ve now got a project on Google code and I now feel like a proper part of the coding community.  We\'ll see how long that lasts.  I\'ve just uploaded the first version of my <a href="http://www.psyked.co.uk/actionscript/application-information-class-for-air.htm">AIR ApplicationInfo</a> class, and no doubt I\'ll be adding, extending and improving on it in the future - with the added bonus that now I\'m not the only one who can contribute.  <a href="http://code.google.com/p/psyked-as-classes/">You can access the project here.</a></p>\n<p>How did I do it?  Well, it\'s really all thanks to <a href="http://internetducttape.com/">Internet Duct Tape</a>\'s <a href="http://internetducttape.com/2007/03/03/howto_google_code_hosting_subversion_tortoisesvn/">"Getting Started with Google Code Hosting, Subversion, and TortoiseSVN without feeling like an Idiot"</a> article, which does exactly what it says on the tin.  I got a Google Code project, learnt what the hell <a href="http://tortoisesvn.tigris.org/">TortoiseSVN</a> actually does, and did it all within 10 minutes.</p>\n<p>Awesome.</p>',frontmatter:{title:"Getting your source code hosted on Google Code...",date:"December 01, 2008",tags:["actionscript","air","applicationinfo","google-code","subversion"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/application-information-class-for-air/",tags:["actionscript","air","applicationinfo"],title:"Application Information Class for AIR",image:null,date:"2008-12-01T08:45:29.000Z"}},next:{frontmatter:{path:"/blog/adm-application-descriptor-manager/",tags:["adobe-air"],title:"ADM - Application Descriptor Manager",image:null,date:"2008-12-02T09:00:22.000Z"}}}}}});
